// TODO: see if we can load shoe from base
function ColorwayTester() {
  const [numberOfColorways, setNumberOfColorways] = useState(1)
  const [isDialogOpen, setIsDialogOpen] = useState(false)
  const [numberAdditionalColorways, setNumberAdditionalColorways] = useState("")
  const TONGUE_INNER_CLASSES = [".st1", ".st2"]
  const TONGUE_CLASSES = [".st3"]
  const WEBBING_CLASSES = [
    ".st5",
    ".st6",
    ".st7",
    ".st8",
    ".st9",
    ".st10",
    ".st11",
    ".st12",
    ".st13",
    ".st14",
    ".st15",
    ".st16",
  ]
  const OUTER_CLASSES = [".st18", ".st19"]
  const DARK_WEBBING = [".st17"]
  // sole color
  const SOLE_CLASSES = [".st175"]
  // laces color
  const LACES_CLASSES = [
    ".st20",
    ".st21",
    ".st22",
    ".st23",
    ".st24",
    ".st25",
    ".st26",
    ".st27",
    ".st28",
    ".st29",
    ".st30",
    ".st31",
    ".st32",
    ".st33",
    ".st34",
    ".st35",
    ".st36",
    ".st37",
    ".st38",
    ".st39",
    ".st40",
    ".st41",
    ".st42",
    ".st43",
    ".st44",
    ".st45",
    ".st46",
    ".st47",
    ".st48",
    ".st49",
    ".st50",
    ".st51",
    ".st52",
  ]

  const EYELET_CLASSES = [
    // ".st4",
    // ".st107",
    // ".st108",
    // ".st109",
    // ".st110",
    // ".st111",
    // ".st112",
    // ".st113",
    // ".st114",
    // ".st115",
    // ".st116",
    // ".st117",
    // ".st118",
    // ".st119",
    // ".st120",
    // ".st121",
    // ".st122",
  ]

  const randomColor = (colors) => {
    return colors[Math.floor(Math.random() * colors.length)]
  }

  const anyColor = () => {
    let colors = [
      "#0F4C81",
      "#C0D725",
      "#7FC844",
      "#A5B8D0",
      "#DBCBBE",
      "#F1EEE6",
      "#373838",
    ]
    return randomColor(colors)
  }

  const randomLaceColor = () => {
    let colors = ["#F1EEE6", "#373838", "#C0D725"]
    return randomColor(colors)
  }

  const fillGroup = (parentClass, classesArray, color) => {
    const parentElement = document.querySelector(parentClass)
    if (parentElement) {
      classesArray.forEach((c) => {
        Array.from(parentElement.querySelectorAll(c)).forEach((element) => {
          element.style.fill = color
        })
      })
    }
  }

  const onSaveNumberAdditionalColorways = () => {
    setNumberOfColorways(numberOfColorways + +numberAdditionalColorways)
    setIsDialogOpen(false)
  }

  const generateColorways = () => {
    setNumberOfColorways(numberOfColorways + 15)
  }

  // brittleish for now, we can fix it later
  let [colorways, setColorways] = useState([])

  useEffect(() => {
    let newColorways = []
    for (let i = 1; i < numberOfColorways; i++) {
      const soleAndLace = randomLaceColor()
      const tongueInner = anyColor()
      const outer = anyColor()
      const webbing = anyColor()
      const eyelet = anyColor()
      const tongue = anyColor()
      const darkWebbing = "rgba(0, 0, 0, 0.5)"

      fillGroup(`.shoePreview-${i}`, TONGUE_INNER_CLASSES, tongueInner)
      fillGroup(`.shoePreview-${i}`, OUTER_CLASSES, outer)
      fillGroup(`.shoePreview-${i}`, WEBBING_CLASSES, webbing)
      fillGroup(`.shoePreview-${i}`, SOLE_CLASSES, soleAndLace)
      fillGroup(`.shoePreview-${i}`, LACES_CLASSES, soleAndLace)
      fillGroup(`.shoePreview-${i}`, EYELET_CLASSES, eyelet)
      fillGroup(`.shoePreview-${i}`, TONGUE_CLASSES, tongue)
      fillGroup(`.shoePreview-${i}`, DARK_WEBBING, darkWebbing)

      newColorways.push({
        Sole: soleAndLace,
        Lace: soleAndLace,
        "Tongue Inner": tongueInner,
        Outer: outer,
        Eyelet: eyelet,
        "Tongue Outer": tongue,
        Webbing: webbing,
        "Webbing Inner": darkWebbing,
      })
    }

    setColorways(newColorways)
  }, [numberOfColorways])

  let previews = []
  for (let i = 0; i < numberOfColorways; i++) {
    previews.push(
      <div style={{ width: "50%", flexShrink: 0, fontFamily: "Roboto Mono" }}>
        <div
          dangerouslySetInnerHTML={{ __html: shoe }}
          className={`shoePreview shoePreview-${i}`}
        />
        <h4>{i == 0 ? "Standard Colorway" : "Alternate Colorway"}</h4>
      </div>
    )
  }

  const onChangeNumberAdditionalColorways = (e) =>
    setNumberAdditionalColorways(e.target.value)

  const animationProps = useSpring({ opacity: 1, from: { opacity: 0 } })
  return (
    <animated.div props={animationProps} style={{ padding: 12 }}>
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          margin: "12px 0 12px 0",
        }}
      >
        <Select
          options={[{ label: "Automate Mens", value: "Automate Mens" }]}
          value="Automate Mens"
          style={{ width: "50%" }}
          placeholder="Select a Product"
        />
        <div style={{ display: "flex", justifySelf: "flex-end" }}>
          <Button icon="download" style={{ marginRight: 12 }}>
            PDF
          </Button>
          <Button icon="share1">Share</Button>
        </div>
      </div>
      <div style={{ marginBottom: 12 }}>
        <Button onClick={generateColorways} variant="primary">
          Generate Colorways
        </Button>
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          flexWrap: "wrap",
          width: "100%",
        }}
      >
        {previews}
      </div>
      {isDialogOpen && (
        <Dialog>
          <Dialog.CloseButton />
          <Heading>How Many?</Heading>
          <Input
            value={numberAdditionalColorways}
            placeholder={0}
            onChange={onChangeNumberAdditionalColorways}
          />
          <Button onClick={() => setIsDialogOpen(false)}>Cancel</Button>
          <Button onClick={onSaveNumberAdditionalColorways} variant="primary">
            Save
          </Button>
        </Dialog>
      )}
    </animated.div>
  )
}

initializeBlock(() => <ColorwayTester />)
